Зимовий костюм Tactical Series 

Виготовлений із міцної ріп-стоп тканини з тефлоновим просоченням DWR, костюм забезпечує захист від вітру, вологи, пилу, а також відштовхує бруд. Утеплювач ThermoLoft (200 г/м²) зберігає тепло до -30°C, а легка підкладка з болоньї додає комфорту.











Особливості костюма:

 	Тканина ріп-стоп (щільність 240 г/м²) – 65% бавовна, 35% поліестер;
 	Тефлонове просочення DWR для водовідштовхувальних властивостей;
 	Утеплювач ThermoLoft, підкладка – болонья;
 	Капюшон регульований, не відстібається;
 	Подовжені манжети, подвійні вставки на зносостійких ділянках;
 	Безліч кишень, якісна фурнітура YKK.

Температурний режим: до -30°C 2XL

