Термошкарпетки неопренові Termal Mest

Розміри в наявності:





 	L (42-43);
 	XL (44-45);
 	2XL (46-47).

Характеристики:

 	Матеріал: неопрен  (поліестер);
 	Колір: чорний;
 	Сезон: осінь/зима;

Країна виробник: Туреччина;
 	Однотонні;
 	Повсякденні;
 	Водонепроникні, мембранні, комфортна посадка.

Догляд: ручне прання в прохолодній воді (не більше 40 °C) і сушіння на повітрі у вертикальному положенні.

Чудово зберігають тепло, а також довговічні та міцні.

Забороняється сушити праскою, на батареях або біля багаття.

