Штани гірка КСЛ ріп-стоп.

Якісне пошиття, міцні шви, надійна фурнітура, тканина щільна та витривала.
Ріп стоп - це міцна тканина, що має комбіновану структуру плетіння з армованою пряжею.

Особливості:

 	В зоні паху вентиляційні кишені на змійці;
 	У зоні колін – кишеня для вкладки наколінників;
 	Внизу штанини всередині додаткова сітка на резинці (натягується на берці), захищає від комах, бруду та пилу;
 	Посилені тканинні накладки в області підвищеного зносу - коліна;
 	У штанинах вшита резинка, яка перешкоджає парусності та запобігає зачепам.
 	Висока талія на резинці, яка захищає тіло від попадання вітру та комфортної посадки.
 	Манжети на резинці;
 	Гульфік (шірінка) застібається на змійку та гудзики;
 	2 бокові кишені, 2 накладні кишені, 2 маленькі кишені спереду;
 	Колір – піксель, мультикам, хижак;
 	Матеріал-  ріп-стоп бавовна, високої якості;
 	Сезон – демісезон/літо
 	Комплектація: штани+ підтяжки                                                                                                                                                                                                                                                                                                 

       Комплект: куртка гірка КСЛ арт. Е4 106 Хижак,52

